from typing import List

def merge_sorted_lists(list1: List[int], list2: List[int]) -> List[int]:
    i, j, res = 0, 0, []
    while i < len(list1) and j < len(list2):
        if list1[i] < list2[j]:
            res.append(list1[i])
            i += 1
        else:
            res.append(list2[j])
            j += 1
    if i < len(list1):
        res.extend(list1[i:])
    if j < len(list2):
        res.extend(list2[j:])
    return res
